import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  View,
  TouchableOpacity,
  Animated,
  TextInput,
  Picker,
} from "react-native";
import Background from "../Component/Background";

const PaymentPage = () => {
  return (
    <View style={styles.container}>
      <Background />
    </View>
  );
};

const styles = StyleSheet.create({});

export default PaymentPage;
